import React from "react";
import client1 from "../../assests/clients/1.svg";
import client2 from "../../assests/clients/2.svg";
import client3 from "../../assests/clients/3.jpg";
import client4 from "../../assests/clients/4.svg";
import client5 from "../../assests/clients/5.svg";
import client6 from "../../assests/clients/6.svg";
import client7 from "../../assests/clients/7.jpg";
import client8 from "../../assests/clients/8.svg";
import client9 from "../../assests/clients/9.svg";
import client10 from "../../assests/clients/10.svg";
import client11 from "../../assests/clients/11.svg";
import client12 from "../../assests/clients/12.svg";
const Clients = () => {
  const clients = [
    {
      name: "client1",
      image: client1,
    },
    {
      name: "client2",
      image: client2,
    },
    {
      name: "client3",
      image: client3,
    },
    {
      name: "client4",
      image: client4,
    },
    {
      name: "client5",
      image: client5,
    },
    {
      name: "client6",
      image: client6,
    },
    {
      name: "client7",
      image: client7,
    },
    {
      name: "client8",
      image: client8,
    },
    {
      name: "client9",
      image: client9,
    },
    {
      name: "client10",
      image: client10,
    },
    {
      name: "client11",
      image: client11,
    },
    {
      name: "client12",
      image: client12,
    },
  ];
  return (
    <div className="flex flex-col max-w-[1300]">
      <h1 className="">Our Clients</h1>
      <div className="grid g justify-center items-center">
        {clients.map((client) => (
          <img key={client.name} src={client.image} alt={client.name} />
        ))}
      </div>
    </div>
  );
};

export default Clients;
